import React from "react";
import { Container, Text } from "../../styledComponents";
import styled from "styled-components";

const SearchWrapper = styled(Container)`
  flex: 0.3;
  flex-direction: row;
  padding-right: 100px;
  padding-top: 30px;
  padding-bottom: 30px;
  padding-left: 100px;
  background-color: "white";
`;
const Houses = () => {
  return (
    <Container column flex={1}>
      <SearchWrapper>
      <Text>What house are you looking for</Text>
      </SearchWrapper>
    </Container>
  );
};

export default Houses;
